function Card(props){

    return(
        <>
        <div><img src={props.imgscr}/></div>
        <p>{props.title}</p>
        <h1>{props.sname}</h1>
         <a href={props.link} target ="_blank">Click Me </a>
        </>
    );

}
export default Card;
